import React, { Component } from 'react';
import MyMapComponent from './MyMapComponent';

export default class MyMap extends Component {


  render() {
    return (
      <MyMapComponent
        isMarkerShown={this.state.isMarkerShown}
        onMarkerClick={this.handleMarkerClick}
      />
    );
  }
}
